import React from 'react';
import { Menu } from 'semantic-ui-react';
import { Link } from '../routes';

export default () => {
  return (
    <Menu style={{ marginTop: '10px' }}>
       <Link route='/'>
        <a ClassName='item'></a>
       </Link>

       <Menu.Item>
        CrowdCoin
       </Menu.Item>

       <Menu.Menu position='right'>
         <Menu.Item>
           Campaigns
         </Menu.Item>

         <Menu.Item>
           +
         </Menu.Item>
       </Menu.Menu>
     </Menu>
  )
}
